      <div className="container display-6">
        <ul>
          <li className="text-primary"> Name : Jagannath Malik</li>
          <li className="text-primary"> Account : 83993773981</li>
          <li className="text-primary"> Aadhar : 3872 3733 3353</li>
          <li className="text-primary"> Pan : KLMS83S</li>
        </ul>
      </div>
    </div>
  );
};
